// src/pages/VisitorInfo.js
import React from 'react';

const VisitorInfo = () => {
  return (
    <div>
      <h1>Welcome, Visitors!</h1>
      <p>We are thrilled to have you join us. Here's what you can expect:</p>
      <ul>
        <li>Service Times: Sundays at 10 AM and 6 PM</li>
        <li>Location: 123 Church Lane, City, State</li>
        <li>Parking: Free parking available at the church lot</li>
        <li>Dress Code: Come as you are!</li>
      </ul>
    </div>
  );
};

export default VisitorInfo;
